import React, { useEffect, useState } from "react";
import SideBarComponent from "../components/SideBarComponent";
import RecipeSearchComponent from "../components/RecipeSearchComponent";
import AvatarIcon from "../images/user-icon.png";

function UserDashboard() {
  useEffect(() => {
    const fectchRecipes = async () => {
      const response = await fetch("http:://localhost:8000/api/recipes");
      const json = await response.json();

      if (!response.ok) {
        console.error(`Failed to fetch recipes. Status: ${response.status}`);
        return;
      }
      console.log(json);
    };

    fectchRecipes();
  }, []);
  return (
    <div className="dashboard">
      <SideBarComponent />
      <header className="dashboard-header">
        <RecipeSearchComponent />
        <div className="dashboard-buttons-container display-f">
          <img className="avatar" src={AvatarIcon} alt="user-icon" />
          <div className="notification-icon-container">
            <svg
              width="24"
              height="24"
              viewBox="0 0 24 24"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                d="M10 21H14C14 22.1 13.1 23 12 23C10.9 23 10 22.1 10 21ZM21 19V20H3V19L5 17V11C5 7.9 7 5.2 10 4.3V4C10 2.9 10.9 2 12 2C13.1 2 14 2.9 14 4V4.3C17 5.2 19 7.9 19 11V17L21 19ZM17 11C17 8.2 14.8 6 12 6C9.2 6 7 8.2 7 11V18H17V11Z"
                fill="black"
              />
            </svg>
          </div>
        </div>
      </header>
    </div>
  );
}

export default UserDashboard;
